// userRoutes.js

import React from 'react'
import { Navigate, Outlet } from 'react-router-dom';

const userRoutes = () => {
    const user = JSON.parse(localStorage.getItem('user'));
    if (user !== null){
        return <Outlet />;
    } else {
        return <Navigate to="/login" />;
    }
}

export default userRoutes;
